name: LUFE
code: complif_default_lufe
config: {}
description: LUFE
entity: lufe
footer: ''
header: ''
html: |
  <!DOCTYPE html>
  <html lang="es">
   <head>
    <meta charset="utf-8"/>
    <meta name="viewport"/>
    <link href="https://fonts.googleapis.com/css2?family=Roboto:wght@400&amp;display=swap" rel="stylesheet"/>
    <style>
     @page {
  /* Márgenes de 0 en los costados */
  margin-left: 0;
  margin-right: 0;
  }
  /* forma de etiquetado generalizada, todos los componentes de este tipo tendran estos estilos */
  body {
  font-family: "Arial", sans-serif;
  line-height: 1.6;
  /* margin: 80px; */
  padding: 0;
  margin: 0;
  color: #333;
  }
  /* forma de etiquetado generalizada compuesta, todos los componentes h1 dentro del header tendran estos estilos, los h1 por fuera del header no los tendran */
  header h1 {
  margin: 0;
  font-size: 2em;
  color: #555;
  }
  /* forma de aplicar estos estilos a todos los componentes que tengan esta clase */
  .header {
  background-color: black;
  padding: 18px 24px;
  display: flex;
  justify-content: flex-end;
  align-items: center;
  /* position: fixed; */
  }
  /* forma para modificar un solo componente en especifico */
  #white_text {
  color: white;
  margin-right: 5px;
  font-size: 14px;
  }
  .container {
  height: 100%;
  padding: 20px 20px 0 20px;
  }
  .information_header_container {
  background-color: #EFEFF0;
  padding: 8px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  }
  .section_title {
  font-size: 18px;
  font-weight: 600;
  }
  .section_sub_title {
  color: #4674A0;
  font-weight: 600;
  margin-top: 8px;
  font-size: 18px;
  margin-bottom: 8px;
  }
  .section_information {
  display: flex;
  }
  .section_information_column {
  width: 50%;
  display: flex;
  flex-direction: column;
  }
  .information_container {
  padding: 16px 8px;
  }
  .information_title {
  width: 50%;
  font-weight: 600;
  }
  .information_value {
  width: 50%;
  }
  .divider {
  width: 100%;
  background-color: #CACACE;
  height: 0.5px;
  margin: 15px 0;
  }
  table {
  width: 100%;
  border-collapse: collapse;
  margin: 20px 0;
  border: 1px solid #ddd;
  }
  .last_modifications {
  display: flex;
  justify-content: space-between;
  width: 85%;
  }
  .debts_container {
  display: flex;
  justify-content: space-between;
  padding: 18px 8px;
  width: 60%;
  }
  th {
  background-color: #f2f2f2 !important;
  padding: 10px;
  text-align: left;
  border-right: 2px solid #ddd;
  border-bottom: 1px solid #ddd;
  }
  td {
  padding: 10px;
  text-align: left;
  border-bottom: 1px solid #ddd;
  /* Línea entre filas */
  }
  .tabla-con-fondo td:first-child,
  .tabla-con-fondo th:first-child {
  background-color: #FAFAFA;;
  }
  th:last-child {
  border-right: none;
  /* Elimina la línea en la última columna */
  }
  @media print {
  /* Forzar salto de página después de cada tabla */
  /* Alternativamente, para agregar un salto de página específico */
  .page-break {
  page-break-before: always;
  }
  }
  .execution_container {
  display: flex;
  }
  .execution_info_container {
  width: 100%;
  display: flex;
  justify-content: space-between;
  margin-left: 30px;
  }
  .image_container {
  display: flex;
  align-items: center;
  }
  .execution_title {
  font-size: 15px;
  font-weight: bold;
  }
  .execution_info {
  width: 50%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  }
  .error_container {
  display: flex;
  }
  .error_text {
  color: #C8341E;
  margin-right: 15px;
  }
  .error {
  color: #C8341E;
  }
  .data_not_found {
  width: 100%;
  display: flex;
  justify-content: center;
  color: #C8341E;
  }
    </style>
   </head>
   <body>
    <main>
     <div class="container">
      <div class="information_header_container">
       <div class="section_title">
        Ejecución
       </div>
       {{#if data.entidad}}
       <div class="image_container">
        <img alt="success_chip" src="data:image/svg+xml;base64," style="height:25px;"/>
       </div>
       {{else}}
       <div class="error_container">
        <div class="error_text">
         {{message}}
        </div>
        <div class="image_container">
         <img alt="error_chip" src="data:image/svg+xml;base64," style="height:25px;"/>
        </div>
       </div>
       {{/if}}
      </div>
      <div class="information_container">
       <div class="execution_container">
        <div class="image_container">
         <img alt="Your SVG Image" id="myImage" src="data:image/png;base64," style="height:85px; width: 85px;"/>
        </div>
        <div class="execution_info_container">
         <div class="execution_info">
          <div class="execution_title">
           Tipo de Ejecución
          </div>
          <div>
           LUFE
          </div>
         </div>
         <div class="execution_info">
          <div class="execution_title">
           Fecha de Ejecución
          </div>
          <div>
           {{formatDate created_at "YYYY-MM-DD HH:mm"}}
          </div>
         </div>
        </div>
       </div>
      </div>
      {{#if data.entidad}}
      <div class="information_header_container">
       <div class="section_title">
        Entidad
       </div>
       <!-- <div class="image_container">
  <img alt="success_chip" style="height:25px;"
  src="data:image/svg+xml;base64,">
  </div> -->
       <!-- <div class="error_container">
  <div class="error_text">Mensaje de error</div>
  <div class="image_container">
  <img alt="error_chip" style="height:25px;"
  src="data:image/svg+xml;base64,">
  </div>
  </div> -->
      </div>
      <div class="information_container">
       <div class="section_sub_title">
        Datos Básicos
       </div>
       <div class="section_information">
        <div class="section_information_column">
         <div class="information_title">
          CUIT
         </div>
         <div class="information_value">
          {{data.entidad.cuit}}
         </div>
         <div class="information_title">
          Nombre
         </div>
         <div class="information_value">
          {{data.entidad.nombre}}
         </div>
         <div class="information_title">
          Domicilio Fiscal
         </div>
         <div class="information_value">
          {{data.entidad.domicilio_fiscal}}
         </div>
        </div>
        <div class="section_information_column">
         <div class="information_title">
          Personería
         </div>
         <div class="information_value">
          {{data.entidad.personeria}}
         </div>
         <div class="information_title">
          Forma Jurídica
         </div>
         <div class="information_value">
          {{data.entidad.forma_juridica}}
         </div>
         <div class="information_title">
          Fecha Contrato Social
         </div>
         <div class="information_value">
          {{formatDate data.entidad.fecha_contrato_social "YYYY-MM-DD"}}
         </div>
        </div>
       </div>
      </div>
      <div class="divider">
      </div>
      <div class="information_container">
       <div class="section_sub_title">
        Certificado MiPyME
       </div>
       <div class="section_information">
        <div class="section_information_column">
         <div class="information_title">
          Número de Registro
         </div>
         <div class="information_value">
          {{data.entidad.certificado_pyme.nro_registro}}
         </div>
         <div class="information_title">
          Categoría
         </div>
         <div class="information_value">
          {{data.entidad.certificado_pyme.categoria}}
         </div>
         <div class="information_title">
          Sector
         </div>
         <div class="information_value">
          {{data.entidad.certificado_pyme.sector}}
         </div>
        </div>
        <div class="section_information_column">
         <div class="information_title">
          Fecha de Emisión
         </div>
         <div class="information_value">
          {{data.entidad.certificado_pyme.fecha_emision}}
         </div>
         <div class="information_title">
          Desde
         </div>
         <div class="information_value">
          {{data.entidad.certificado_pyme.desde}}
         </div>
         <div class="information_title">
          Hasta
         </div>
         <div class="information_value">
          {{data.entidad.certificado_pyme.hasta}}
         </div>
        </div>
       </div>
      </div>
      <div class="divider">
      </div>
      <div class="information_container">
       <div class="section_sub_title">
        Datos de Empleo
       </div>
       <table>
        <thead>
         <tr>
          <th>
           Período
          </th>
          <th>
           Fecha de Presentación
          </th>
          <th>
           Empleados
          </th>
          <th>
           Masa Salarial Bruta
          </th>
          <th>
           Rectificación
          </th>
         </tr>
        </thead>
        <tbody>
         {{#if data.entidad.empleo}}
  {{#each data.entidad.empleo}}
         <tr>
          <td>
           {{periodo}}
          </td>
          <td>
           {{fecha_presentacion}}
          </td>
          <td>
           {{empleados}}
          </td>
          <td>
           {{formatNumber masa_salarial_bruta}}
          </td>
          <td>
           {{numero_rectificacion}}
          </td>
         </tr>
         {{/each}}
  {{else}}
         <tr>
          <td colspan="5">
           <div class="data_not_found">
            No hay información de empleo
           </div>
          </td>
         </tr>
         {{/if}}
        </tbody>
       </table>
      </div>
      <!-- <div class="page-break"></div> -->
      <div class="information_container">
       <div class="section_sub_title">
        Impuestos
       </div>
       <table>
        <thead>
         <tr>
          <th>
           Código
          </th>
          <th>
           Descripción
          </th>
          <th>
           Estado
          </th>
          <th>
           Vigente
          </th>
          <th>
           Origen Inscripción
          </th>
          <th>
           Actualización
          </th>
         </tr>
        </thead>
        <tbody>
         {{#if data.entidad.impuestos}}
  {{#each data.entidad.impuestos}}
         <tr>
          <td>
           {{codigo_caracterizacion}}
          </td>
          <td>
           {{descripcion}}
          </td>
          <td>
           {{estado}}
          </td>
          <td>
           {{periodo_vigencia}}
          </td>
          <td>
           {{origen}}
          </td>
          <td>
           {{fecha_actualizacion}}
          </td>
         </tr>
         {{/each}}
  {{else}}
         <tr>
          <td colspan="5">
           <div class="data_not_found">
            No hay información de impuestos
           </div>
          </td>
         </tr>
         {{/if}}
        </tbody>
       </table>
      </div>
      <div class="information_container">
       <div class="section_sub_title">
        Regímenes
       </div>
       <table>
        <thead>
         <tr>
          <th>
           Período
          </th>
          <th>
           Estado
          </th>
          <th>
           Régimen
          </th>
          <th>
           Impuesto
          </th>
          <th>
           Tipo
          </th>
          <th>
           Descripción
          </th>
         </tr>
        </thead>
        <tbody>
         {{#if data.entidad.regimenes}}
  {{#each data.entidad.regimenes}}
         <tr>
          <td>
           {{periodo}}
          </td>
          <td>
           {{estado}}
          </td>
          <td>
           {{idRegimen}}
          </td>
          <td>
           {{idImpuesto}}
          </td>
          <td>
           {{tipoRegimen}}
          </td>
          <td>
           {{descripcionRegimen}}
          </td>
         </tr>
         {{/each}}
  {{else}}
         <tr>
          <td colspan="6">
           <div class="data_not_found">
            No hay información de regímenes
           </div>
          </td>
         </tr>
         {{/if}}
        </tbody>
       </table>
      </div>
      <div class="information_container">
       <div class="section_sub_title">
        Últimas modificaciones
       </div>
       <div class="last_modifications">
        <div>
         <div>
          Autoridades
         </div>
         <div>
          {{#if data.entidad.ultimas_modificaciones.autoridades}}
          <th>
           {{formatDate data.entidad.ultimas_modificaciones.autoridades "YYYY-MM-DD"}}
          </th>
          {{else}} - {{/if}}
         </div>
        </div>
        <div>
         <div>
          Documentos
         </div>
         <div>
          {{#if data.entidad.ultimas_modificaciones.documentos}}
          <th>
           {{formatDate data.entidad.ultimas_modificaciones.documentos "YYYY-MM-DD"}}
          </th>
          {{else}} - {{/if}}
         </div>
        </div>
        <div>
         <div>
          Indicadores
         </div>
         <div>
          {{#if data.entidad.ultimas_modificaciones.indicadores}}
          <th>
           {{formatDate data.entidad.ultimas_modificaciones.indicadores "YYYY-MM-DD"}}
          </th>
          {{else}} - {{/if}}
         </div>
        </div>
       </div>
      </div>
      <div class="information_header_container">
       <div class="section_title">
        Deudas
       </div>
      </div>
      {{#if data.deudas}}
      <div class="debts_container">
       <div>
        <div>
         Deuda Impositiva o Social
        </div>
        <div>
         {{#ifCond data.deudas.tiene_deuda_impositiva_social "===" null}}-{{/ifCond}}{{#ifCond data.deudas.tiene_deuda_impositiva_social "===" true}}Sí{{/ifCond}}{{#ifCond data.deudas.tiene_deuda_impositiva_social "===" false}}No{{/ifCond}}
        </div>
       </div>
       <div>
        <div>
         Deuda Social
        </div>
        <div>
         {{#ifCond data.deudas.tiene_deuda_social "===" null}}-{{/ifCond}}{{#ifCond data.deudas.tiene_deuda_social "===" true}}Sí{{/ifCond}}{{#ifCond data.deudas.tiene_deuda_social "===" false}}No{{/ifCond}}
        </div>
       </div>
      </div>
      {{#if data.deudas.tiene_deuda_impositiva_social}}
      <div class="information_container">
       <table>
        <thead>
         <tr>
          <th>
           Impuesto
          </th>
          <th>
           Periodo
          </th>
          <th>
           Descripción
          </th>
         </tr>
        </thead>
        <tbody>
         {{#if data.deudas.deudas.deuda}}
  {{#each data.deudas.deudas.deuda}}
         <tr>
          <td>
           {{impuesto}}
          </td>
          <td>
           {{periodoFiscal}}
          </td>
          <td>
           {{descripcion}}
          </td>
         </tr>
         {{/each}}
  {{else}}
         <tr>
          <td colspan="3">
           <div class="data_not_found">
            No hay detalle de deudas
           </div>
          </td>
         </tr>
         {{/if}}
        </tbody>
       </table>
      </div>
      {{/if}}
  {{else}}
      <div>
       <div>
        Error
       </div>
       <div>
        DEUDAS_SERVICE_UNAVAILABLE
       </div>
      </div>
      {{/if}}
      <div class="information_header_container">
       <div class="section_title">
        Autoridades y Accionistas
       </div>
       <!-- <div class="image_container">
  <img alt="success_chip" style="height:25px;"
  src="data:image/svg+xml;base64,">
  </div>
  <div class="error_container">
  <div class="error_text">Mensaje de error</div>
  <div class="image_container">
  <img alt="error_chip" style="height:25px;"
  src="data:image/svg+xml;base64,">
  </div>
  </div> -->
      </div>
      <div class="information_container">
       <table>
        <thead>
         <tr>
          <th>
           CUIT
          </th>
          <th>
           Denominación
          </th>
          <th>
           Cargo
          </th>
          <th>
           Accionista
          </th>
          <th>
           Acciones (%)
          </th>
         </tr>
        </thead>
        <tbody>
         {{#if data.autoridades}}
  {{#each data.autoridades}}
         <tr>
          <td>
           {{cuit}}
          </td>
          <td>
           {{denominacion}}
          </td>
          <td>
           {{cargo}}
          </td>
          <td>
           {{#if es_accionista}}Si{{else}}No{{/if}}
          </td>
          <td>
           {{#if es_accionista}}{{porc_accionista}}{{else}} - {{/if}}
          </td>
         </tr>
         {{/each}}
  {{else}}
         <tr>
          <td colspan="5">
           <div class="data_not_found">
            No hay información de autoridades
           </div>
          </td>
         </tr>
         {{/if}}
        </tbody>
       </table>
      </div>
      <div class="information_header_container">
       <div class="section_title">
        Ventas y Compras
       </div>
      </div>
      <div class="information_container">
       <table>
        <thead>
         <tr>
          <th>
           Período
          </th>
          <th>
           Ventas
          </th>
          <th>
           Compras
          </th>
         </tr>
        </thead>
        <tbody>
         {{#if data.indicadores_post_balance}}
  {{#each data.indicadores_post_balance}}
         <tr>
          <td>
           {{periodo}}
          </td>
          {{#if ventas includeZero=true}}
          <td>
           {{formatNumber ventas}}
          </td>
          {{else}}
          <td>
           -
          </td>
          {{/if}}
  {{#if compras includeZero=true}}
          <td>
           {{formatNumber compras}}
          </td>
          {{else}}
          <td>
           -
          </td>
          {{/if}}
         </tr>
         {{/each}}
  {{else}}
         <tr>
          <td colspan="3">
           <div class="data_not_found">
            No hay información de ventas y compras
           </div>
          </td>
         </tr>
         {{/if}}
        </tbody>
       </table>
      </div>
      <div class="information_header_container">
       <div class="section_title">
        Indicadores
       </div>
      </div>
      <div class="information_container">
       <table class="tabla-con-fondo">
        <thead>
         <tr>
          <th>
           Período
          </th>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <th>
           {{ip.periodo}}
          </th>
          {{/ifCond}}
  {{/each}}
         </tr>
        </thead>
        <tbody>
         <tr>
          <td>
           Fecha de Presentación
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{ip.data.fechapresentacion}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Endeudamiento
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.endeudamiento}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Endeudamiento Diferido
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.endeudamiento_diferido}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Liquidez Corriente
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.liquidez_cte}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Liquidez Ácida
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.liquidez_acida}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Solvencia
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.solvencia}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Ebit
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.ebit}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Ebitda
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.ebitda}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Ebit sobre Ventas
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.ebit_vtas}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Ebitda sobre Ventas
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.ebitda_vtas}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
         <tr>
          <td>
           Rentabilidad
          </td>
          {{#each data.indicadores_por_periodo as | ip |}}
  {{#ifCond ip.data.periodo "&gt;=" 202100}}
          <td>
           {{formatNumber ip.data.rentabilidad}}
          </td>
          {{/ifCond}}
  {{/each}}
         </tr>
